script: |
  super -f text -I q8361.spq | sort > q8361.out

inputs:
  - name: q8361.spq
    data: |
      SELECT DISTINCT - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + + 90 BETWEEN + 48 AND - col2 * - ( 88 ) OR - ( col2 ) * + 42 NOT IN ( + 23 * + col1 + + col0 );
  - name: tab1

outputs:
  - name: q8361.out
    data: |
      -51
      -85
      -91
